🟠EMENDAMENTO APPROVATO SULLA PRODUZIONE IDROELETTRICA SU ACQUEDOTTI

Felicissimo di annunciare l'approvazione di questo importantissimo #emendamento, scritto dal collega Filippo Perconti e presentato al #Senato da me. Continua qui 👉https://t.co/MEktMM11JS

@M5S_Senato https://t.co/SQie7rsjwD

era una luce accesa su un tema urgente per la vita degli italiani.
Siamo amareggiati, certo, ma quello che è importante davvero resta tale e continueremo a lavorarci fino a che potremo.

Non ci fermiamo! 

@SenatoriPD 
